import React from 'react';
import ReactDOM from 'react-dom';

import Cards from "./Cards";
import './index.css';

function App(){
    return (
        <React.Fragment>
        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>

        <Cards 
          crdimg = {Sdata[0].simgsrc}
          title=  {Sdata[0].stitle}
          category= {Sdata[0].scategory} 
          link= {Sdata[0].scategory} 
        />
        <Cards 
          crdimg = "https://m.media-amazon.com/images/M/MV5BYzJiNDBlZDAtYTM1MS00OWQwLTg1MWItYmExMDY4YWJmNGIxXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_UY209_CR4,0,140,209_AL_.jpg" 
          title="Top Boy" 
          category="Thriller" 
          link="https://www.imdb.com/title/tt1830379/?ref_=ttls_li_tt"

        />
        <Cards 
          crdimg = "https://m.media-amazon.com/images/M/MV5BODZlYjQ4NzYtZTg1MC00NGY4LTg4NjQtNGE3ZjRkMjk3YjMyXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_UY209_CR13,0,140,209_AL_.jpg" 
          title="Stranger Things" 
          category="Horror" 
          link="https://www.imdb.com/title/tt4574334/?ref_=ttls_li_tt"        
        />
      </React.Fragment>
    )
}

export default App;
